function check_login_cm(siteUrl){if($("#username").val()&&$("#password").val()){$.ajax({url:siteUrl+'home/login/Check_login',type:"POST",data:{user_put:$("#username").val(),pass_put:$("#password").val()},cache:false,beforeSend:function(){document.getElementById("login-submit").disabled=true;$('#login-submit').html('ang ng nhp...');},success:function(data){if(data){$('#myModal').modal('hide');var redirect=siteUrl;window.location=redirect;}else{document.getElementById("login-submit").disabled=false;$('.error_submit').html("Tn ng nhp hoc mt khu khng ng! Vui lng th li");}},error:function(){$('.error_submit').html("Tn ng nhp hoc mt khu khng ng! Vui lng th li");document.getElementById("login-submit").disabled=false;}});}else{alert('Bn cha nhp thng tin ng nhp!');}}
function check_regis_cm(siteUrl){if($('#username_regis').val()==''){alert('Bn cha nhp Tn ng nhp!');return false;}
if($('#password_regis').val()==''){alert('Bn cha nhp mt khu!');return false;}
if($('#email_regis').val()==''){alert('Bn cha nhp email!');return false;}
if(!checkEmail($('#email_regis').val())){alert('Email khng hp l!');return false;}
if($('#mobile_regis').val()==''){alert('Bn cha nhp s in thoi!');return false;}
if(!CheckPhone($('#mobile_regis').val())){alert('S in thoi ch c php nhp s!');return false;}
if($('#province_regis').val()==''){alert('Bn cha nhp tnh thnh!');return false;}
if($('#district_regis').val()==''){alert('Bn cha nhp qun/ huyn!');return false;}else{$.ajax({url:siteUrl+'home/register/Check_register',type:"post",data:$(this).serialize(),beforeSend:function(){document.getElementById("login-submit").disabled=true;$('#register-submit').html('ang ng k...');},success:function(data){if(data==2){alert("Vui lng nhp Capcha!");return false;}
$('#myModal').modal('hide');var redirect=siteUrl;window.location=redirect;},error:function(){alert('C li xy ra! Bn vui lng ng k li.');}});}}
function loadDist(siteUrl){if($("#user_province_get").val()){$.ajax({url:siteUrl+'home/showcart/getDistrict',type:"POST",data:{user_province_put:$("#user_province_get").val()},cache:true,beforeSend:function(){document.getElementById("user_province_get").disabled=true;},success:function(response){document.getElementById("user_province_get").disabled=false;if(response){var json=JSON.parse(response);emptySelectBoxById('user_district_get',json);delete json;}else{alert("Li! Vui lng th li");}},error:function(){alert("Li! Vui lng th li");}});}}
